import React from 'react';
import NewInput from '../components/Imputs/inputs';
import fakeData from '../fakeData/operators.json';
import { NavLink } from 'react-router-dom';

const Payment = () => {
  return (
    <div className="centrForm">
      {fakeData.map((item) => (
        <h1 key={item.id}>
          <NavLink to={`/payment/${item.id}`}>{item.name}</NavLink>
        </h1>
      ))}
    </div>
  );
};

export default Payment;
